    name: "Hoang",
    email: "haha@gmail.com"
};
const element = (
    <div className="hello">
        <h1>Hello my name is</h1>
        <h2>Email: {user.email}</h2>
    </div>
);

var numbers= [1,2,3,4];
var doublenumbers = numbers.map((eachnum) => eachnum * 2 + ', ');
var counter = 0;

